        //【输入框输入内容事件】
        poiInput.oninput = () => {
            poiInputClose.hidden = false;
        };

        //添加提示框
        this.messageBox = new MessageBox();
        //绑定 VM 的监听
        this._addViewModelListener();
        div.appendChild(poiContainer);

        //阻止 map 默认事件
        this._preventMapEvent(div, this.map);
        return div;
