        let unitSelectSpan = external_L_default().DomUtil.create('span', '', unitSelectBoxContainer);
        unitSelectSpan.innerHTML = options.labelName;
        let unitSelectInputContainer = external_L_default().DomUtil.create('div', '', unitSelectBoxContainer);
